  class Tile {
    /** @type {HTMLImageElement} */
    #image;

    /**
     * @param {string} src
     */
    constructor(src) {
      this.#image = new Image();
      this.#image.src = src;
    }

    /**
     * @param {CanvasRenderingContext2D} ctx
     * @param {number} dx
     * @param {number} dy
     * @param {number} dw
     * @param {number} dh
     */
    draw(ctx, dx, dy, dw, dh) {
      ctx.drawImage(this.#image, dx, dy, dw, dh);
    }

    static [0] = new Tile("assets/empty.png");
    static [1] = new Tile("assets/socket.png");
    static [2] = new Tile("assets/wall.png");
    static [4] = new Tile("assets/crate.png");
    static [5] = new Tile("assets/socket-crate.png");
    static [8] = new Tile("assets/player.png");
    static [9] = new Tile("assets/player.png");
  }

  class Sokoban {
    static EMPTY = 0;
    static SOCKET = 1;
    static WALL = 2;
    static CRATE = 4;
    static PLAYER = 8;

    static TICK = 100;

    /** @type {HTMLCanvasElement} */
    #canvas;

    /** @type {CanvasRenderingContext2D} */
    #ctx;

    /** @type {Level} */
    #level;

    /** @type {number} */
    #moves;

    /** @type {number[]} */
    #tiles;

    /** @type {number} */
    #timer;

    /**
     * @param {HTMLCanvasElement} canvas
     */
    constructor(canvas) {
      this.#canvas = canvas;
      this.#ctx = canvas.getContext("2d");
    }

    /**
     * The player's current position.
     *
     * @type {number}
     */
    get #position() {
      return this.#tiles.findIndex((tile) => tile & Sokoban.PLAYER);
    }

    #draw(ctx = this.#ctx) {
      ctx.clearRect(0, 0, this.#canvas.width, this.#canvas.height);

      const scale = this.#canvas.width / this.#level.width;

      for (let i = 0; i < this.#tiles.length; i++) {
        const dx = i % this.#level.width;
        const dy = Math.floor(i / this.#level.width);
        const tile = Tile[this.#tiles[i]];

        tile.draw(ctx, dx * scale, dy * scale, scale, scale);
      }

      const time = new Date(this.#timer);

      const formattedTime = [time.getMinutes(), time.getSeconds()]
        .map((part) => part.toString().padStart(2, "0"))
        .join(":");

      ctx.fillStyle = "white";
      ctx.font = "bold 24px sans-serif";

      ctx.textAlign = "center";
      ctx.fillText(
        `${this.#moves.toString().padStart(4)}  /  ${formattedTime}`,
        this.#canvas.width / 2,
        this.#canvas.height
      );
    }

    /**
     * @param {KeyboardEvent} event
     */
    #handleInput({ key, repeat }) {
      if (!repeat) {
        switch (key) {
          case "ArrowDown":
          case "Down":
          case "s":
            this.#move(0, +1);
            break;

          case "ArrowLeft":
          case "Left":
          case "a":
            this.#move(-1, 0);
            break;

          case "ArrowRight":
          case "Right":
          case "d":
            this.#move(+1, 0);
            break;

          case "ArrowUp":
          case "Up":
          case "w":
            this.#move(0, -1);
            break;
        }
      }
    }

    /**
     * @param {number} dx
     * @param {number} dy
     */
    #move(dx, dy, from = this.#position) {
      const to = this.#position + dx + dy * this.#level.width;

      if (this.#tiles[to] & Sokoban.CRATE) {
        this.#push(dx, dy, to);
      }

      if (
        this.#tiles[to] === Sokoban.EMPTY ||
        this.#tiles[to] === Sokoban.SOCKET
      ) {
        this.#tiles[from] -= Sokoban.PLAYER;
        this.#tiles[to] += Sokoban.PLAYER;
        this.#moves += 1;
      }
    }

    /**
     * @param {number} dx
     * @param {number} dy
     */
    #push(dx, dy, from) {
      const to = from + dx + dy * this.#level.width;

      if (
        this.#tiles[to] === Sokoban.EMPTY ||
        this.#tiles[to] === Sokoban.SOCKET
      ) {
        this.#tiles[from] -= Sokoban.CRATE;
        this.#tiles[to] += Sokoban.CRATE;
      }
    }

    #startLoop() {
      window.addEventListener("keydown", this.#handleInput.bind(this));
      const interval = setInterval(this.#tick.bind(this), 100);

      const loop = () => {
        this.#draw();

        if (this.#tiles.some((tile) => tile === Sokoban.CRATE)) {
          requestAnimationFrame(loop);
        } else {
          window.removeEventListener("keydown", this.#handleInput.bind(this));
          clearInterval(interval);
          requestAnimationFrame(next);
        }
      };

      const next = () => {
        alert("Winner");
        this.play(1);
      };

      loop();
    }

    #tick() {
      this.#timer += Sokoban.TICK;
    }

    /**
     * Play the game.
     *
     * @param {number} level
     */
    play(level = 0) {
      this.#level = Level[level];
      this.#tiles = [...this.#level.tiles];
      this.#moves = 0;
      this.#timer = 0;

      this.#startLoop();
    }
  }

  return Sokoban;

